sipProfileForwardSipNonRefreshment.desc:
The parameter is an forward SIP call switch in case of no Session Expire header received in SIP UPDATE/ReINVITE. The feature impacts on the SIP initial Invite message encode,It should be got from the incoming SIP Profile during call setup phase.

When the parameter is set to true, the feature is enabled and if it fits the following 4 conditions MGC will not forward SIP UPDATE(after 200OK)/ReINVITE to another terminal.
condition 1st: the parameter is set to true;
condition 2nd: InternalWorkMode is eWithMGW;
condition 3rd: no Session Expires Header;
condition 4th: with SDP & SDP version is new;

When the parameter is set to false, the feature is disabled.

By default, the parameter is set to true.
